import {
      BrowserRouter as Router,
      Routes,
      Route
    } from "react-router";



import Home from './components/ListEmployeeComponent';

ReactDOM.render(
    <>

      <div className='content-wrapper'>
        <div className='main-content'>
            <Route exact path='/' component={Home} />

        </div>
      </div>
     
    </>,
 document.getElementById('root')
)
